"use strict";

var burger = document.querySelector('.burger--menu');
var burgerClose = document.querySelector('.burger--close');
var menu = document.querySelector('.header__nav');
burger.addEventListener('click', function () {
  menu.classList.add('active');
});
burgerClose.addEventListener('click', function () {
  menu.classList.remove('active');
});

if (document.getElementById("map")) {
  ymaps.ready(init);
}

function init() {
  var myMap = new ymaps.Map("map", {
    center: [45.070880074584196, 38.92577099999997],
    zoom: 17,
    controls: []
  });
  var placemark = new ymaps.Placemark([45.070880074584196, 38.92577099999997], {}, {
    iconLayout: 'default#image',
    iconImageHref: '../img/placemark.svg',
    iconImageSize: [41, 41]
  });
  myMap.geoObjects.add(placemark);
  myMap.behaviors.disable('drag');
  myMap.behaviors.disable('scrollZoom');
  myMap.controls.remove('searchControl');
  myMap.controls.remove('trafficControl');
  myMap.controls.remove('typeSelector');
  myMap.controls.remove('fullscreenControl');
  myMap.controls.remove('rulerControl');
}

if (document.querySelector(".back-btn")) {
  document.querySelector(".back-btn").addEventListener('click', function () {
    window.history.back();
  });
}

if (document.getElementById('carouselExample')) {
  var swiper = new Swiper('.coordination__swiper', {
    slidesPerView: 1,
    spaceBetween: 30,
    pagination: {
      el: '.coordination__pagination',
      type: 'bullets',
      clickable: true
    },
    breakpoints: {
      768: {
        slidesPerView: 1,
        loop: true,
        centeredSlides: true,
        navigation: {
          nextEl: ".coordination__btn-next",
          prevEl: ".coordination__btn-prev"
        }
      },
      992: {
        slidesPerView: "auto",
        loop: true,
        centeredSlides: true,
        navigation: {
          nextEl: ".coordination__btn-next",
          prevEl: ".coordination__btn-prev"
        }
      }
    }
  });
}
